							if (barRemainPart % answerstotal == 0) { //בדיקה האם מספר הפריימים שנשארו מתחלק בצורה שלמה במספר הלחיצות שנשארו
								barJump = barRemainPart / answerstotal; //הגדרת הקפיצה הראשונה של בר ההתקדמות
							}
							barPart += barJump; //הגדלת מספר הפריים אליו צריך להתקדם לפי הקפיצה שחושבה
							barRemainPart -= barJump; //הקטנת מספר הפריימים שנשארו בגודל הקפיצה שנעשתה
							answerstotal--; //הקטנת מספר הלחיצות ב 1 כדי שהחישוב הבא יהיה מתאים למספר הלחיצות החדש שנשאר
